import { BrowserRouter, Route, Routes } from 'react-router-dom';
import AppRouter from './components/AppRouter';
import React from 'react';

function App() {
  return (
    <Routes>
      <Route path="/" element={<AppRouter />} />
    </Routes>
  );
}

export default App;
